import React from "react";

const Item = (props) => {
  console.log("====================================");
  console.log(props.image);
  console.log("====================================");
  return (
    <div>
      <span>{props.brand}</span>
      <span>{props.title}</span>
      <span>{props.price}</span>
      <img src={require(`../assets/media/${props}`)} alt="image" />
    </div>
  );
};

export default Item;
